import image_snowflake from "assets/images/falling/snowflake.png"


const FallingAnimate = () => {

    const snows =["snow1","snow2","snow3"]


    return(
        <div>
            {snows.map((snow, idx) => (
                <img src={image_snowflake} className={`absolute z-10 w-[8%] h-[12%] animate-${snow}`} key={idx} />
            ))}
        </div>
    )
}

export default FallingAnimate;
